
import { register } from '../core.js';

const lookup = "";

const chunks = {
  "wordpress-01.svg": new URL("./wordpress-01.svg", import.meta.url).href,
  "wordpress-02.svg": new URL("./wordpress-02.svg", import.meta.url).href
};

register('wordpress', {
  lookup,
  chunks,
  baseUrl: import.meta.url
});
